class Solution:
    def findTheDifference(self, s: str, t: str) -> str:
        h1 = {}
        h2 = {}
        ln = len(s)
        i = 0
        while i < ln:
            h1[s[i]] = h1[s[i]] + 1 if h1.get(s[i]) else 1
            h2[t[i]] = h2[t[i]] + 1 if h2.get(t[i]) else 1
            i+=1
        h2[t[i]] = h2[t[i]] + 1 if h2.get(t[i]) else 1

        for k in h2.keys():
            if not h1.get(k) or h1[k] != h2[k]:
                return k


i = Solution()
call = i.findTheDifference("", "")
print(":: ", call)
